import React from 'react'
import MediaCard from '../components/TeamCards/Card.jsx';
import { Grid } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    gridContainer: {
      justify: 'center',
    },
});

function E_Board() {
    const classes = useStyles();
    return (
        <Grid container spacing={3} className={classes.gridContainer} justify="center">
                <Grid item sm={6} md={4}>
                    <MediaCard />
                </Grid>
                <Grid item sm={6} md={4}>
                    <MediaCard />
                </Grid>
                <Grid item sm={6} md={4}>
                    <MediaCard />
                </Grid>
                <Grid item sm={6} md={4}>
                    <MediaCard />
                </Grid>
                <Grid item sm={6} md={4}>
                    <MediaCard />
                </Grid>
        </Grid>
    )
}

export default E_Board
